import { connect,useSelector } from 'react-redux';
import SuccessLogin from '../components/SuccessLogin';
import {truelogin} from '../modules/successlogin';
const SuccessContainer = () => {
    const truelogin = useSelector(state => state.link )
    return <SuccessLogin link={truelogin}/>;
};

const mapStateToProps = state => ({
    // link: state.successlogin.link, //이 코드 수정해야할 지도
    link: state.link,
});

const mapDispatchToProps = dispatch => ({
    login: () =>{
       dispatch(truelogin());
    }
})
export default connect(
    mapStateToProps,
    mapDispatchToProps,
)(SuccessContainer);
